(function(){function c(){this.keys={};this.value=null}c.prototype.set=function(b,a){var d=b.shift();this.keys[d]||(this.keys[d]=new c(1));b.length?this.keys[d].set(b,a):this.keys[d].value=a};c.prototype.get=function(){if(!arguments.length)return null;for(var b=[],a=0;a<arguments.length;a++)b.push(arguments[a]);return(a=b.shift())&&this.keys[a]?this.keys[a].get(b):this.value};window.MultiKey=c})();
